import { useProperties } from "../../providers/Properties";
import { ContainerGlobal, ContainerPropertyCard } from "./styles";

function PropertyCard() {
  const { properties } = useProperties();
  console.log(properties);
  return (
    <ContainerGlobal>
      <ContainerPropertyCard>
        <p>{properties[0].goal}</p>
        <p>{properties[0].type}</p>
        <img src={properties[0].mainImage} alt={"House"} />
        <p></p>
      </ContainerPropertyCard>
    </ContainerGlobal>
  );
}

export default PropertyCard;
